import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import AppShell from './components/AppShell';
import Dashboard from './pages/Dashboard';
import Teams from './pages/Teams';
import TeamMember from './pages/TeamMember';
import Surveys from './pages/Surveys';
import Reports from './pages/Reports';
import EntryFlow from './pages/EntryFlow';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Check if user is authenticated from localStorage
    const authStatus = localStorage.getItem('isAuthenticated');
    const userData = localStorage.getItem('user');

    if (authStatus === 'true' && userData) {
      setIsAuthenticated(true);
      setUser(JSON.parse(userData));
    }
  }, []);

  const login = (userData) => {
    setIsAuthenticated(true);
    setUser(userData);
    localStorage.setItem('isAuthenticated', 'true');
    localStorage.setItem('user', JSON.stringify(userData));
  };

  const logout = () => {
    setIsAuthenticated(false);
    setUser(null);
    localStorage.removeItem('isAuthenticated');
    localStorage.removeItem('user');
  };

  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Public routes */}
          <Route path="/" element={
            isAuthenticated ? <Navigate to="/app" /> : <LandingPage />
          } />
          <Route path="/login" element={
            isAuthenticated ? <Navigate to="/app" /> : <LoginPage onLogin={login} />
          } />
          <Route path="/signup" element={
            isAuthenticated ? <Navigate to="/app" /> : <SignupPage onSignup={login} />
          } />

          {/* Protected app routes */}
          <Route path="/app" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <Dashboard />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/teams" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <Teams />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/teams/:memberId" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <TeamMember />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/surveys" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <Surveys />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/reports" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <Reports />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/entry" element={
            isAuthenticated ? (
              <AppShell user={user} onLogout={logout}>
                <EntryFlow />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
